import { useState } from 'react';
import './App.css';
import Modal from './components/Modal';

import Posts from './components/Posts';

function App() {
  const [modalActive, setModalActive] = useState;
  return (
    <div className="App">
      <Posts />
      <Modal />
    </div>
  );
}

export default App;
